import React, { Component } from 'react';
import Shopping from '../Shopping';
import './List.scss';

class List extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}

	render() {
		return (
			<div id="list">
				this.props.data.map((shopping, index) = {
					<Shopping 
						key={index}
						urlImage={shopping.urlImage}
						text={shopping.text}
						arrTags={shopping.arrTags}
					/>
				});
			{/*
				{this.props.shoppingList.map((shopping, index) => (
					<Shopping
						key={index}
						urlImage={shopping.urlImage}
						text={shopping.text}
						arrTags={shopping.arrTags} 
					/>
				))}
			*/}
			</div>
		);
	}
}

export default List;
